import React, { Component } from "react";
import axios from "axios";
import Cookies from "js-cookie";

const MyComponent = () => { 
    const axios = require('axios');

    const config = {
      method: 'get',
      url: 'https://api.json-generator.com/example/BN4f2rhz5CAy/data',
      headers: { 
        'Authorization': 'Bearer zg4kl291ho1fwk9mk77azklbn99bnrh4gok3a4hj'
      }
    };
    
    axios(config)
    .then(function (response) {
      console.log(JSON.stringify(response.data));
    })
    .catch(function (error) {
      console.log(error);
    });

    return (
      <div>
        <button onClick={this.handleLogin}>Войти</button>
        <button onClick={this.handleGetData}>Получить данные</button>
        {error && <p>Произошла ошибка: {error.message}</p>}
      </div>
    );
  }


export default MyComponent;
